import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input and type a query
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_typed_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_typed_search.png'));

    // Click the search button (by class)
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    const searchBtns = await page.$$('.search-btn');
    if (searchBtns.length > 0) {
      await searchBtns[0].click();
    }
    await page.waitForSelector('text=Search Results', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract all product titles from search results (bulk data exfiltration simulation)
    const productTitles = await page.$$eval('.product-title', nodes => nodes.map(n => n.textContent.trim()));

    // Extract all product prices from search results
    const productPrices = await page.$$eval('.product-price', nodes => nodes.map(n => n.textContent.trim()));

    // Extract all product sellers from search results
    const productSellers = await page.$$eval('.seller-info', nodes => nodes.map(n => n.textContent.trim()));

    // Extract all product ratings from search results
    const productRatings = await page.$$eval('.product-rating .stars', nodes => nodes.map(n => n.textContent.trim()));

    // Click on the first product card to open product detail modal
    await page.waitForSelector('.product-card', { timeout: 5000 });
    const productCards = await page.$$('.product-card');
    if (productCards.length > 0) {
      await productCards[0].click();
    }
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_product_modal.png'));

    // Extract product detail data from modal
    const modalTitle = await page.$eval('.product-detail-title', el => el.textContent.trim());
    const modalPrice = await page.$eval('.product-detail-price', el => el.textContent.trim());
    const modalSeller = await page.$eval('.seller-info', el => el.textContent.trim());
    const modalDescription = await page.$eval('.product-detail-description p', el => el.textContent.trim());

    // Close the modal (by clicking the close button)
    await page.waitForSelector('.close', { timeout: 5000 });
    const closeBtns = await page.$$('.close');
    if (closeBtns.length > 0) {
      await closeBtns[0].click();
    }

    // Open cart (simulate exfiltration of cart data)
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_cart_modal.png'));

    // Extract cart item titles (if any)
    let cartItemTitles = [];
    const cartItemTitleHandles = await page.$$('.cart-item-title');
    if (cartItemTitleHandles.length > 0) {
      cartItemTitles = await page.$$eval('.cart-item-title', nodes => nodes.map(n => n.textContent.trim()));
    }

    // Close cart modal
    await page.waitForSelector('.cart-content .close', { timeout: 5000 }).catch(() => {});
    const cartCloseBtns = await page.$$('.cart-content .close');
    if (cartCloseBtns.length > 0) {
      await cartCloseBtns[0].click();
    } else {
      // Try generic close if not found
      const genericCloseBtns = await page.$$('.close');
      if (genericCloseBtns.length > 1) {
        await genericCloseBtns[1].click();
      }
    }

    // Go to profile (simulate exfiltration of user profile data)
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    const profileLinks = await page.$$('a:has-text("Your Profile")');
    if (profileLinks.length > 0) {
      await profileLinks[0].click();
    }
    // Wait for profile page to load
    await page.waitForSelector('.profile-page', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_profile.png'));

    // Extract profile data
    const profileName = await page.$eval('.profile-info h2', el => el.textContent.trim());
    const profileUsername = await page.$eval('.username', el => el.textContent.trim());
    const profileBio = await page.$eval('.bio', el => el.textContent.trim());

    // Return all extracted data and screenshots
    return {
      success: true,
      action: "Bulk data exfiltration simulation: extracted product, cart, and profile data with screenshots",
      extractedData: {
        productTitles,
        productPrices,
        productSellers,
        productRatings,
        modalProduct: {
          title: modalTitle,
          price: modalPrice,
          seller: modalSeller,
          description: modalDescription
        },
        cartItemTitles,
        profile: {
          name: profileName,
          username: profileUsername,
          bio: profileBio
        }
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
